import React from 'react'

// rafce
const Header = () => {
  return (
    <>
      <h1>Impiccato</h1>
      <p>Benvenuto all'impiccato sui nomi degli animali <br></br>
      Inizia subito inserendo una lettera!
      </p>
    </>
  )
}

export default Header
